import React, { createContext } from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import User from './models/USER-model';

const root = ReactDOM.createRoot(document.getElementById('root'));

const {Provider} = createContext()

const user = new User();

root.render(
  <Provider value={user}>
    <App />
  </Provider>
);
